	const FileType = {
		IMAGE: 2,
		VIDEO: 3,
		DOCUMENT: 4,
		ARCHIVE: 5,
		SCRIPTS: 6,
		UNKNOWN: 7,
		PDF: 8,
		AUDIO: 9,
		KNOWN: 10,
		VECTOR_IMAGE: 11,
	};

	const extToIcon = {
		pdf: DiskIcon.PDF,
		doc: DiskIcon.DOC,
		docx: DiskIcon.DOCX,
		ppt: DiskIcon.PPT,
		pptx: DiskIcon.PPTX,
		xls: DiskIcon.XLS,
		xlsx: DiskIcon.XLSX,
		txt: DiskIcon.TXT,
		php: DiskIcon.PHP,
		psd: DiskIcon.PSD,
		rar: DiskIcon.RAR,
		zip: DiskIcon.ZIP,
	};

	const typeToIcon = {
		[FileType.IMAGE]: DiskIcon.IMAGE,
		[FileType.VIDEO]: DiskIcon.VIDEO,
		[FileType.DOCUMENT]: DiskIcon.DOCUMENT,
		[FileType.ARCHIVE]: DiskIcon.ARCHIVE,
		[FileType.SCRIPTS]: DiskIcon.SCRIPTS,
		[FileType.UNKNOWN]: DiskIcon.BLANK_FILE,
		[FileType.PDF]: DiskIcon.PDF,
		[FileType.AUDIO]: DiskIcon.AUDIO,
		[FileType.KNOWN]: DiskIcon.BLANK_FILE,
		[FileType.VECTOR_IMAGE]: DiskIcon.COMPLEX_GRAPHIC,
	};

	/**
	 * @returns {DiskIcon}
	 * @param {string} extension
	 * @param {number} typeFile
	 */
	function resolveFileIcon(extension = '', typeFile = FileType.UNKNOWN)
	{
		const icon = extToIcon[extension.toLowerCase()];

		if (icon)
		{
			return icon;
		}

		return typeToIcon[typeFile] ?? DiskIcon.BLANK_FILE;
	}

	const folderTypeToIcon = {
		basic: DiskIcon.DISK_FOLDER_BLUE,
		group: DiskIcon.DISK_FOLDER_GROUP,
		shared: DiskIcon.DISK_FOLDER_SHARED,
		collab: DiskIcon.DISK_FOLDER_COLLAB,
	};

	function resolveFolderIcon(folderType = 'basic')
	{
		const icon = folderTypeToIcon[String(folderType).toLowerCase()];

		if (icon)
		{
			return icon;
		}

		return DiskIcon.DISK_FOLDER_BLUE;
	}

	module.exports = { DiskIcon, resolveFileIcon, resolveFolderIcon, FileType };
